template<typename T1, typename T2> struct Dict_ : public Ref_ {
	Dict_() noexcept : Ref_(), L(0LL), B(nullptr) {}
	int64_t Len() noexcept { return L; }
	void Add(T1 k, T2 v) noexcept {
		bool a;
		B = dictAdd_<T1, T2>(B, k, v, &a);
		if (a)
			L++;
	}
	int64_t L;
	dictImpl_<T1, T2>* B;
};
