static uint64_t ModPow(uint64_t value, uint64_t exponent, uint64_t modulus)
{
	uint64_t w = 1;
	while (exponent > 0)
	{
		if ((exponent & 1) != 0)
			w = ModMul(w, value, modulus);
		value = ModMul(value, value, modulus);
		exponent >>= 1;
	}
	return w;
}
static bool _prime(int64_t n)
{
	if (n <= 1)
		return false;
	if ((n & 1) == 0)
		return n == 2;
	if (n <= 1920000)
	{
		if (n == 3)
			return true;
		if (n % 6 != 1 && n % 6 != 5)
			return false;
		int64_t m = n / 6 * 2 + (n % 6 == 1 ? 0 : 1);
		size_t size;
		const uint8_t* primes_bin = GetPrimesBin(&size);
		return (primes_bin[m / 8] & (1 << (m % 8))) != 0;
	}

	// Miller-Rabin primality test.
	uint64_t enough;
	if (n < 2047)
		enough = 1;
	else if (n < 1373653)
		enough = 2;
	else if (n < 25326001)
		enough = 3;
	else if (n < 3215031751)
		enough = 4;
	else if (n < 2152302898747)
		enough = 5;
	else if (n < 3474749660383)
		enough = 6;
	else if (n < 341550071728321)
		enough = 7;
	else if (n < 3825123056546413051)
		enough = 9;
	else
	{
		// n < 2^64 < 318665857834031151167461
		enough = 12;
	}
	{
		uint64_t d = (uint64_t)n - 1;
		uint64_t s = 0;
		while ((d & 1) == 0)
		{
			s++;
			d >>= 1;
		}
		for (uint64_t i = 0; i < enough; i++)
		{
			uint64_t x = ModPow(Primes[i], d, (uint64_t)n);
			uint64_t j;
			if (x == 1 || x == (uint64_t)n - 1)
				continue;
			bool probablyPrime = false;
			for (j = 0; j < s; j++)
			{
				x = ModPow(x, 2, (uint64_t)n);
				if (x == (uint64_t)n - 1)
				{
					probablyPrime = true;
					break;
				}
			}
			if (!probablyPrime)
				return false;
		}
		return true;
	}
}
static int64_t FindFactor(int64_t n)
{
	// Pollard's rho algorithm.
	uint64_t n2 = (int64_t)n;
	for (; ; )
	{
		if (n2 % 2 == 0)
			return 2;
		if (_prime((int64_t)n2))
			return (int64_t)n2;
		uint64_t a = (uint64_t)xs128_() << 32;
		a |= (uint64_t)xs128_();
		uint64_t y = a % (n2 + 1);
		uint64_t c = (uint64_t)xs128_() + 1;
		uint64_t m = (uint64_t)xs128_() + 1;
		uint64_t g;
		uint64_t r = 1;
		uint64_t q = 1;
		uint64_t ys = 0;
		uint64_t x;
		uint64_t i;
		do
		{
			x = y;
			for (i = 0; i < r; i++)
				y = (ModMul(y, y, n2) + c) % n2;
			uint64_t k = 0;
			do
			{
				ys = y;
				uint64_t min_value = m < r - k ? m : r - k;
				for (i = 0; i < min_value; i++)
				{
					y = (ModMul(y, y, n2) + c) % n2;
					q = ModMul(q, x > y ? x - y : y - x, n2);
				}
				g = _gcd((int64_t)q, (int64_t)n2);
				k += m;
			} while (k < r && g <= 1);
			r *= 2;
		} while (g <= 1);
		if (g == n2)
		{
			do
			{
				ys = (ModMul(ys, ys, n2) + c) % n2;
				g = _gcd((int64_t)(x > ys ? x - ys : ys - x), (int64_t)n2);
			} while (g <= 1);
		}
		if (g == n2)
			/*seed++*/;
		else
			n2 = g;
	}
}
static int CmpInt(const void* a, const void* b)
{
	return *(int64_t*)a > *(int64_t*)b ? 1 : -1;
}
